import React, { Component } from 'react';
import { NavLink } from "react-router-dom";

const css = {
  position: "fixed",
  width: "250px",
  backgroundColor: "#004e92"
};
class Nav extends Component {
  render() {
    return (
     <div style={css}  className="list-group-item">
      <NavLink className="" role="" aria-controls="home">Home</NavLink> <br/>
      <NavLink className="" role="" aria-controls="home">Home</NavLink>
     
    
    </div>
    );
  }
}

export default Nav;
